import React from 'react';
import { Link, useNavigate } from 'react-router-dom';

const Home = () => {
    const navigate = useNavigate();
    return (
        <div>
            <h1 className="font-bold text-center text-2xl p-4">
                Marwari Colleg Important Question
            </h1>
            <div>
                <h1
                    onClick={(e) => {
                        navigate('/sem-4');
                    }}
                >
                    Sem 4
                </h1>
            </div>
        </div>
    );
};

export default Home;
